Another interesting property of no_std applications is that we cannot use Rust's default main function as our entry point. It makes certain assumptions that are not necessarily valid in an embedded context (for example, it expects that command-line arguments exist). Because of this, you will often see the #![no_main] attribute used to instruct the Rust compiler not to use the default entry point. Runtime crates will provide an #[entry] attribute which can be used to mark a diverging function as the application's entry point instead. For example, a minimal application might look something like this: #![no_std]
#![no_main] use riscv_rt::entry; #[entry]
fn main() -> ! { loop {}
}

