In addition to specifying the application's entry point, for no_std we must also define a panic handler. The default panic behaviour relies on std, as it prints to standard output. You can define a panic handler manually using the #[panic_handler] attribute. Note that this function's signature must match the example below. #![no_std] use core::panic::PanicInfo; #[panic_handler]
fn panic(info: &PanicInfo) -> ! { // Your implementation goes here!
} Alternatively, there are a number of external dependencies which define various panic handlers for us. Some possible choices are panic-halt , panic-semihosting , or panic-never . These can be used simply by installing the relevant dependency, and then importing the crate: #![no_std] use panic_halt as _; Probably the most convenient panic handler for no_std on esp-hal is esp-backtrace

